  return (
    <View style={styles.container}>
      <Map/>
    </View>
  );
}

const styles = StyleSheet.create({
  center:{
    flex:1,
    justifyContent:'center',
    alignItems:'center'
  },
  modalView: {
    backgroundColor:'#fff',
    borderRadius: 4,
    padding:20,
    shadowColor:'#000',
    shadowOffset: {
        width:0,
        height:3,  
      }
  },
  map:  {
    height: Dimensions.get('window').height,
    width: Dimensions.get('window').width
  },
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
